import React from 'react';
import './App.css';
import internal from 'stream';
import MovementTable from './MovementTable';

interface MyProps {
};

interface MyState {
  input: string;
  addFarm: boolean;
  addMovement: boolean;
};

class App extends React.Component<MyProps,MyState>{
  constructor(props : MyProps){
    super(props);

    this.state = {
      input : "",
      addFarm: false,
      addMovement: false
    };

    this.handleChange = this.handleChange.bind(this);
    this.handleFarmClick = this.handleFarmClick.bind(this);
    this.handleMovementClick = this.handleMovementClick.bind(this);
    this.handleSubmit = this.handleSubmit.bind(this);
  }

  handleChange(event: React.FormEvent<HTMLInputElement>){
    this.setState({
      input: event.currentform.value
    });
  }

  handleFarmClick(){
    this.setState((state)=>({
      addFarm: !state.addFarm
    }));
  }

  handleMovementClick(){
    this.setState((state)=>({
      addMovement: !state.addMovement
    }));
  }

  handleFarmSubmit(event: React.SyntheticEvent<HTMLFormElement>){
    event.preventDefault()
    const form = event.currentTarget
    const data = {
      name: form.name.value,
      email: form.email.value,
      password: form.password.value,
      confirmPassword:form.confirmPassword.value,
      conditionsAccepted: form.conditionsAccepted.checked,
    };
  }

  render(): React.ReactNode {
    const addFarmForm = (
      <form className="pure-form" onSubmit={this.handleFSubmit}>
        <fieldset>
            <input placeholder="Premise Id" />
            <input placeholder="Name" />
            <input placeholder="Address" />
            <input placeholder="City" />
            <input placeholder="State" />
            <input placeholder="Postal Code" />
            <input placeholder="Total Population" />
            <button type="submit" className="pure-button pure-button-primary">Add</button>
        </fieldset>
      </form>

    );

    const addMovementForm =(
      <form className="pure-form">
        <fieldset>
            <input placeholder="Movement Id" />
            <input placeholder="Company" />
            <input placeholder="Origin Premise Id" />
            <input placeholder="Destination Premise Id" />
            <input placeholder="Species" />
            <input placeholder="Shipment Start Date" />
            <input placeholder="Reason" />
            <button type="submit" className="pure-button pure-button-primary">Add</button>
        </fieldset>
      </form>
    );

    return(
      <div>
        <div className="header">

          <div className="pure-menu pure-menu-horizontal">
            <a className="pure-menu-heading"></a>

            <ul className="pure-menu-list">
              <li className="pure-menu-item">
                <a href="#" className="pure-menu-link" onClick={this.handleFarmClick}>Add Farm</a>
              </li>
              <li className="pure-menu-item">
                <a href="#" className="pure-menu-link" onClick={this.handleMovementClick}>Add Movement</a>
              </li>
              <li className="pure-menu-item">
                <form className="pure-form">
                  <fieldset>
                  <input value={this.state.input} onChange={this.handleChange}/>
                  <button type="submit" className="pure-button pure-button-primary">Search</button>
                  </fieldset>
                </form>
              </li>
            </ul>
          </div>
        </div>
        <div>
          {this.state.addFarm ? addFarmForm : null}
          {this.state.addMovement ? addMovementForm : null}
        </div>
        <div>
          <MovementTable/>
        </div>
      </div>
    )
  }
}

export default App;
